import React from 'react'
import "./header.css";

import {Container,Row,Button} from 'reactstrap';
import { NavLink,Link } from 'react-router-dom';
import logo from "../../assets/images/logo.png";

const nav_links =[{
  path:'/home',
  display:'Home'
},
{
  path:'#',
  display:'About'
},
{
  path:'/tours',
  display:'Tours'
},
// {
//   path:'/tours/:id',
//   display:'TourDetails'
// },
// {
//   path:'/login',
//   display:'Login'
// },
// {
//   path:'/register',
//   display:'Register'
// },
// {
//   path:'/tours/search',
//   display:'SearchResult'
// },
]

const Header = () => {
  return <header className='header'>
    <Container>
      <Row>
        <div className="nav-wrapper d-flex align-items-center justify-content-between">

          {/* logo */}
            <div className="logo">
              <img src={logo} alt="" width="300px"/>
            </div>

          {/* logo end */}

          {/* menu start */}
          <div className="navigation">
            <ul className='menu d-flex align-items-center gap-5' >
              {
                nav_links.map((item,index) =>(
                  <li className="nav_item" key={index}>
                    <NavLink to={item.path}>{item.display}</NavLink>
                  </li>
                ))
              }
            </ul>
          </div>
          {/* menu end */}


          <div className="nav_right align-items-center d-flex gap-5">
            <div className="nav_btns  align-items-center d-flex gap-5">
              <Button className='btn secondary_btn'><Link to="/login">Login</Link></Button>
              <Button className='btn primary_btn'><Link to="/register">Register</Link></Button>
            </div>

            <span className="mobile_menu">
            <i class="ri-menu-line"></i>
            </span>
          </div>



        </div>
      </Row>
    </Container>

  </header>
}

export default Header
